import React, { Component } from 'react';
import runes from './lol_data/runesReforged.json';
import './App.css';

const serverAddress = 'localhost:8080';

class App extends Component {
   constructor() {
      super();

      this.state = {};
      console.log(runes);
   }

   render() {
      return (
         <div className="App">
            <div id="AppContainer">
               <input type='text' autoFocus='autofocus' />
            </div>
         </div>
      );
   }
}

export default App;
